import React from "react";
import { View } from "react-native";

interface SlideProps {
    label: String;
    right?: boolean;
}

const Slide = ({ label, right}: SlideProps) => {
    return (
        <View>
            <Text>{label}</Text>
        </View>
    );
};

export default Slide;
